const Card = (props) => {
    const {name,email} = pros;
    return (
        <div className='bg-light-green dib br3 pa3 ma2 bw2 shadow-5 grow'>
            <img alt='photo' src={'https://robohash.org/${props.id}?200x200'} />
            <div>
                <h2>{props.name}</h2>
                <p>{props.email}</p>
            </div>
        </div>
    )
}

export default Card;
